(()=>{"use strict";(e=>{const t=document.getElementById("timer-days"),n=document.getElementById("timer-hours"),o=document.getElementById("timer-minutes"),m=document.getElementById("timer-seconds"),s=()=>{let e=(new Date("1 november 2021").getTime()-(new Date).getTime())/1e3;return{timeRemaining:e,days:Math.floor(e/60/60/24),hours:Math.floor(e/60/60%24),minutes:Math.floor(e/60%60),seconds:Math.floor(e%60)}},i=(e,t)=>{e.textContent=t<10?`0${t}`:t};setInterval((()=>{s().timeRemaining>0&&(i(t,s().days),i(n,s().hours),i(o,s().minutes),i(m,s().seconds))}),1e3)})(),console.log("two.js")})();